import React from 'react';
import styled from 'styled-components';
import Layout from '../components/Layout';
import about1 from '../assets/about1.png';
import about2 from '../assets/about2.png';
import { Link } from 'react-router-dom';

const HeroContainer = styled.section`
  width: 1552px;
  height: 234px;
  margin: 48px auto 0 auto;
  border-radius: 6px;
  background: #004C97;
  display: flex;
  align-items: center;
  justify-content: center;
  @media (max-width: 1600px) {
    width: 98vw;
    min-width: 320px;
  }
`;

const HeroText = styled.h1`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 96px;
  line-height: 150%;
  letter-spacing: -2.3%;
  color: #fff;
  margin: 0;
  text-align: center;
`;

const MainSection = styled.section`
  width: 1552px;
  min-height: 822px;
  margin: 48px auto 0 auto;
  border-radius: 6px;
  background: #E9F6FF;
  border: 4px solid #A4D6FF;
  display: flex;
  flex-direction: row;
  align-items: stretch;
  justify-content: space-between;
  position: relative;
  padding: 0;
  box-sizing: border-box;
  @media (max-width: 1600px) {
    width: 98vw;
    min-width: 320px;
    flex-direction: column;
    align-items: center;
    padding: 0;
  }
`;

const MissionContent = styled.div`
  flex: 1 1 0;
  padding: 64px 32px 64px 64px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  @media (max-width: 1200px) {
    padding: 32px 24px;
  }
`;

const MissionTitle = styled.h2`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 64px;
  line-height: 150%;
  letter-spacing: -2.2%;
  color: #1E1E1E;
  margin: 0 0 32px 0;
`;

const MissionText = styled.p`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 500;
  font-size: 28px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #1E1E1E;
  margin-bottom: 32px;
`;

const AboutImage1 = styled.img`
  width: 605px;
  height: 653px;
  object-fit: cover;
  border-radius: 6px;
  align-self: flex-end;
  margin: 64px 64px 64px 0;
  @media (max-width: 1200px) {
    width: 90vw;
    height: auto;
    margin: 32px auto 0 auto;
    align-self: center;
  }
`;

const WhySection = styled.section`
  width: 1552px;
  min-height: 460px;
  margin: 48px auto 0 auto;
  display: flex;
  flex-direction: row;
  align-items: stretch;
  justify-content: space-between;
  position: relative;
  @media (max-width: 1600px) {
    width: 98vw;
    min-width: 320px;
    flex-direction: column;
    align-items: center;
  }
`;

const WhyContent = styled.div`
  flex: 2 1 0;
  padding: 64px 32px 64px 64px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  @media (max-width: 1200px) {
    padding: 32px 24px;
  }
`;

const WhyTitle = styled.h2`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 64px;
  line-height: 150%;
  letter-spacing: -2.2%;
  color: #1E1E1E;
  margin: 0 0 32px 0;
`;

const WhyList = styled.ul`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 500;
  font-size: 28px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #1E1E1E;
  margin-bottom: 32px;
  padding-left: 24px;
`;

const WhyListItem = styled.li`
  margin-bottom: 18px;
`;

const AboutImage2 = styled.img`
  width: 468px;
  height: 460px;
  object-fit: cover;
  border-radius: 6px;
  align-self: flex-end;
  margin: 64px 64px 64px 0;
  @media (max-width: 1200px) {
    width: 90vw;
    height: auto;
    margin: 32px auto 0 auto;
    align-self: center;
  }
`;

const LetsConnectButton = styled(Link)`
  width: 197px;
  height: 68px;
  background: linear-gradient(90deg, #FF9E42 0%, #FFC287 100%);
  border-radius: 6px;
  display: flex;
  justify-content: center;
  align-items: center;
  text-decoration: none;
  margin-top: 20px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 19px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #FFFFFF;
  border: none;
  cursor: pointer;
  transition: transform 0.2s ease;
  &:hover {
    transform: scale(1.05);
  }
`;

const About = () => (
  <Layout>
    <HeroContainer>
      <HeroText>About Us</HeroText>
    </HeroContainer>
    <MainSection>
      <MissionContent>
        <MissionTitle>Our mission</MissionTitle>
