        </MissionText>
      </MissionContent>
      <AboutImage1 src={about1} alt="Our mission" />
    </MainSection>
    <WhySection>
      <WhyContent>
        <WhyTitle>Why us?</WhyTitle>
        <WhyList>
          <WhyListItem>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</WhyListItem>
          <WhyListItem>Aenean suscipit justo vel interdum bibendum.</WhyListItem>
          <WhyListItem>Duis auctor erat vel sollicitudin aliquam. Proin at eros eu mauris interdum feugiat ac eu purus. ut egestas justo, sed condimentum lacus facilisis.</WhyListItem>
